  \ are named with IDs $0, 1, ..., n-1$. $u$ is ID of the target vertex and $k$ denotes\
  \ its degree. $v_i (i = 1, 2, ... k)$ denote IDs of vertices adjacent to $u$ and\
  \ $c_i$ denotes the weight of a directed edge connecting $u$ and $v_i$ (from $u$\
  \ to $v_i$).\n\nOutput\n\nFor each vertex, print its ID and the distance separated\
  \ by a space character in a line respectively. Print in order of vertex IDs.\n\n\
  Example\n\nInput\n\n5\n0 3 2 3 3 1 1 2\n1 2 0 2 3 4\n2 3 0 3 3 1 4 1\n3 4 2 1 0\
  \ 1 1 4 4 3\n4 2 2 1 3 3\n\n\nOutput\n\n0 0\n1 2\n2 2\n3 1\n4 3\nA: ```import heapq\n\
  \nn = int(input())\nC = [[] for _ in range(n)]\nfor _ in range(n):\n    tmp = list(map(int,input().split()))\n\
  \    for i in range(1,tmp[1]+1):\n        C[tmp[0]].append(tuple(tmp[2*i:2*i+2]))\n\
  \nq = []\n\ndef heap_dijkstra(start = 0):\n    visited = [False]*n\n    INF = 10000000000\n\
  \    d = [INF]*n\n\n    d[start] = 0\n    visited[start] = True\n    add_node =\
  \ start\n\n    for i in range(n-1):\n        for adj_weight in C[add_node]:\n  \
  \          if visited[adj_weight[0]] == False:\n                heapq.heappush(q,(d[add_node]+adj_weight[1],adj_weight[0]))\n\
  \n        while 1:\n            tmp = heapq.heappop(q)\n            if visited[tmp[1]]\
  \ == False:\n                min_weight = tmp[0]\n                min_node = tmp[1]\n\
  \                break\n        \n        add_node = min_node\n        visited[min_node]\
  \ = True\n        d[min_node] = min_weight\n    \n    return d\n\nD = heap_dijkstra()\n\
  \nfor i in range(n):\n    print(\"{} {}\".format(i,D[i]))```\nQ: Write python code\
